import './App.css';
import NavigationBars from './component/NavigationBar';
import { Container, Row ,Col} from "react-bootstrap";
import Welcome from './component/Welcome';

function App() {
  const margintop={
    margintop:"20px"
  }
  return (
    <div className="App">
      <NavigationBars />
      <Container>
        <Row>
          <Col lg={12} style={margintop}>
          <Welcome />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
